import React from "react";
import Section from "./Section";

const BlogList = (props) => (
  <Section>
    <div>
      <div className="blog padding">
        <div>
          <time>01/10/2020</time>
          <h1>The Blog Will Go Here</h1>
        </div>
        <a href="#" className="link">
          Read More
        </a>
      </div>
    </div>
  </Section>
);

export default BlogList;
